import XCTest
@testable import BigInt

class BigIntTests: XCTestCase {
    
    override func setUp() {
        super.setUp()
        // Put setup code here. This method is called before the invocation of each test method in the class.
    }
    
    override func tearDown() {
        // Put teardown code here. This method is called after the invocation of each test method in the class.
        super.tearDown()
    }
    
    func testSizeInBase() {
        let x = try! BigInt("115792089237316195423570985008687907853269984665640564039457584007913129639935") // This 0xff..ff on 32 bytes
        XCTAssertEqual(x.size(inBase: .ten), 78)
        XCTAssertEqual(x.size(inBase: .sixteen), 64)
        XCTAssertEqual(x.byteSize(), 32)
        let y = BigInt(x).add(1)
        XCTAssertEqual(y.size(inBase: .ten), 78)
        XCTAssertEqual(y.size(inBase: .sixteen), 65)
        XCTAssertEqual(y.byteSize(), 33)
    }
    
    func testToStringConversion() {
        let val = BigInt()
        for i in 0..<2048 {
            val.set(i)
            let s = String(val)
            XCTAssert(s == "\(i)")
        }
        // From 2^31 to 2^31+2^20
        for i in 2147483648..<2148532224 {
            val.set(i)
            let s = String(val)
            XCTAssert(s == "\(i)")
        }
        // From 2^63 to 2^63+2^20
        for i in 4611686018427387904..<4611686018428436480 {
            val.set(i)
            let s = String(val)
            XCTAssert(s == "\(i)")
        }
    }
    
    func testStringConversions() {
        let numberOfConversions = 10000
        for _ in 0..<numberOfConversions {
            var stringValue1 = ""
            for _ in 0..<64 {
                let r = arc4random()
                stringValue1 += "\(r)"
            }
            let val = try! BigInt(stringValue1)
            let stringValue2 = String(val)
            XCTAssertEqual(stringValue1, stringValue2)
        }
    }

    func testUIntConversions() {
        let numberOfConversions = 10000
        let op = BigInt()
        for _ in 0..<numberOfConversions {
            let r = UInt(arc4random())
            op.set(r)
            XCTAssertEqual(r, try! UInt(op))
        }
    }

    func testIntConversion() {
        for r in -1000..<1000 {
            let op = BigInt(r)
            XCTAssertEqual(try! Int(op), r)
        }
        // From -2^60 to -2^60+1024
        for r in -1152921504606846976 ..< -1152921504606845952 {
            let op = BigInt(r)
            XCTAssertEqual(try! Int(op), r)
        }
    }

    func testAdd() {
        let op1 = BigInt()
        let op2 = BigInt()
        let rop = BigInt()
        let numberOfSimpleTests = 10000
        for _ in 0..<numberOfSimpleTests {
            let r1 = UInt(arc4random())
            let r2 = UInt(arc4random())
            op1.set(r1)
            op2.set(r2)
            BigInt.add(rop: rop, op1: op1, op2: op2)
            XCTAssertEqual(try! UInt(rop), r1+r2)
        }
        // We test that op1 can be both a destination and source
        for _ in 0..<numberOfSimpleTests {
            let r1 = UInt(arc4random())
            let r2 = UInt(arc4random())
            op1.set(r1)
            op2.set(r2)
            BigInt.add(rop: op1, op1: op1, op2: op2)
            XCTAssertEqual(try! UInt(op1), r1+r2)
        }
        // We test that op2 can be both a destination and source
        for _ in 0..<numberOfSimpleTests {
            let r1 = UInt(arc4random())
            let r2 = UInt(arc4random())
            op1.set(r1)
            op2.set(r2)
            BigInt.add(rop: op2, op1: op1, op2: op2)
            XCTAssertEqual(try! UInt(op2), r1+r2)
        }
        // We test the addition of an UInt
        for _ in 0..<numberOfSimpleTests {
            let r1 = UInt(arc4random())
            let r2 = UInt(arc4random())
            op1.set(r1)
            BigInt.add(rop: rop, op1: op1, op2: r2)
            XCTAssertEqual(try! UInt(rop), r1+r2)
        }
        
    }
    
    func testSub() {
        let t = try! BigInt("105753235500385031285733285557429586206307182974579332567036624336102865712393")
        let res1 = BigInt()
        BigInt.sub(rop: res1, op1: BigInt(1), op2: t)
        let res2 = BigInt(1).sub(t)
        let expectedResult = try! BigInt("-105753235500385031285733285557429586206307182974579332567036624336102865712392")
        XCTAssertEqual(res1, expectedResult)
        XCTAssertEqual(res2, expectedResult)
    }

    func testNeg() {
        let op1 = BigInt()
        let op2 = BigInt()
        let rop = BigInt()
        let numberOfSimpleTests = 10000
        for _ in 0..<numberOfSimpleTests {
            let r = UInt(arc4random())
            op1.set(r)
            BigInt.neg(rop: op2, op: op1)
            BigInt.add(rop: rop, op1: op1, op2: op2)
            XCTAssertEqual(try! Int(rop), 0)
        }
    }

    func testMod() {
        let rop = BigInt()
        let op = BigInt()
        let n = BigInt()
        // 13 mod 7 = 6
        op.set(13)
        n.set(7)
        BigInt.mod(rop: rop, op: op, modulo: n)
        XCTAssertEqual(try! Int(rop), 6)
        let numberOfSimpleTests = 10000
        for _ in 0..<numberOfSimpleTests {
            let _op = UInt(arc4random())
            let _n = UInt(arc4random())/100
            op.set(_op)
            n.set(_n)
            BigInt.mod(rop: rop, op: op, modulo: n)
            XCTAssertEqual(try! UInt(rop), _op % _n)
        }
    }

