    func testCmp() {
        let op1 = BigInt()
        let op2 = BigInt()
        let numberOfSimpleTests = 10000
        for _ in 0..<numberOfSimpleTests {
            let r1 = UInt(arc4random())
            let r2 = UInt(arc4random())
            op1.set(r1)
            op2.set(r2)
            if r1 < r2 {
                XCTAssert(op1 < op2)
            } else if r1 == r2 {
                XCTAssert(op1 == op2)
            } else {
                XCTAssert(op1 > op2)
            }
            op2.set(r1)
            XCTAssert(op1 == op2)
        }
    }

    func testMulWithSmallNumbers() {
        let op1 = BigInt()
        let op2 = BigInt()
        let rop = BigInt()
        let numberOfTests = 1000
        for _ in 0..<numberOfTests {
            let r1 = Int(arc4random())/2
            let r2 = Int(arc4random())/2
            op1.set(r1)
            op2.set(r2)
            BigInt.mul(rop: rop, op1: op1, op2: op2)
            XCTAssertEqual(try! Int(rop), r1*r2)
        }
    }

