    func testMulModWithSmallNumbers() {
        let op1 = BigInt()
        let op2 = BigInt()
        let rop = BigInt()
        let n = BigInt()
        let numberOfTests = 1000
        for _ in 0..<numberOfTests {
            let r1 = Int(arc4random())/2
            let r2 = Int(arc4random())/2
            let r3 = Int(arc4random())
            op1.set(r1)
            op2.set(r2)
            n.set(r3)
            BigInt.mul(rop: rop, op1: op1, op2: op2, modulo: n)
            XCTAssertEqual(try! Int(rop), (r1*r2) % r3)
        }
    }

    func testSetWithInvalidString() {
        let op = BigInt()
        let s = "abc"
        do {
            try op.set(s)
        } catch BigIntError.invalidInitializationString(let invalidString, let base) {
            XCTAssertEqual(invalidString, s)
            XCTAssertEqual(base, .ten)
        } catch {
            XCTFail("Invalid error")
        }
    }

    func testBigIntTooBigForNativeTypes() {
        let op = try! BigInt("9223372036854775807") // 2^63 - 1
        XCTAssertNoThrow(try Int(op))
        try! op.set("9223372036854775808") // 2^63
        do {
            _ = try Int(op)
        } catch BigIntError.bigIntIsTooBigForInt {
        } catch {
            XCTFail("Cannot convert BigInt to Int")
        }
        try! op.set("18446744073709551615") // 2^64 - 1
        XCTAssertNoThrow(try UInt(op))
        try! op.set("18446744073709551616") // 2^64
        do {
            _ = try UInt(op)
        } catch BigIntError.bigIntIsTooBigForUInt {
        } catch {
            XCTFail("Cannot convert BigInt to Int")
        }
    }

    func testModularInvertDoesNotExists() {
        let op = BigInt(6)
        let n = BigInt(9)
        let rop = BigInt()
        do {
            try BigInt.invert(rop: rop, op: op, modulo: n)
        } catch BigIntError.modularInverseDoesNotExists {
        } catch {
            XCTFail("testModularInvertDoesNotExists: invert should throw modularInverseDoesNotExists")
        }
    }

    func testInitWithBytes() {
        // Test [0x00, 0x00, 0x00, 0x00] --> 0
        var bytes: [UInt8] = [0x00, 0x00, 0x00, 0x00]
        var computedBigInt = BigInt(bytes)
        var expectedBigInt = BigInt(0)
        XCTAssertEqual(computedBigInt, expectedBigInt)
        // Test [0x00, 0x00, 0x00, 0x01] --> 1
        bytes = [0x00, 0x00, 0x00, 0x01]
        computedBigInt = BigInt(bytes)
        expectedBigInt = BigInt(1)
