    func testGetBytes() {
        var computedBigInt = BigInt(0)
        for nbrBytes in 0..<128 {
            let computedBytes = try! [UInt8](computedBigInt, count: nbrBytes)
            let expectedBytes = [UInt8](repeating: 0, count: nbrBytes)
            XCTAssertEqual(computedBytes, expectedBytes)
        }
        computedBigInt = BigInt(1)
        for nbrBytes in 1..<128 {
            let computedBytes = try! [UInt8](computedBigInt, count: nbrBytes)
            var expectedBytes = [UInt8](repeating: 0, count: nbrBytes)
            expectedBytes[expectedBytes.count - 1] = 0x01
            XCTAssertEqual(computedBytes, expectedBytes)
        }
        // 61344910120423901417682508861433655792482432536131290366293772313666283849796 --> [0x87, 0x9f, 0xfd, 0x1b, 0x52, 0x7, 0xf2, 0xe2, 0xea, 0x54, 0xfc, 0x0, 0xc, 0xcc, 0x1e, 0x19, 0x49, 0xe0, 0x5c, 0x23, 0xec, 0xa8, 0xb9, 0x8a, 0x9a, 0xc1, 0xf7, 0x83, 0xfe, 0x3b, 0x48, 0x44] (on 32 bytes)
        var expectedBytes: [UInt8] = [0x87, 0x9f, 0xfd, 0x1b, 0x52, 0x7, 0xf2, 0xe2, 0xea, 0x54, 0xfc, 0x0, 0xc, 0xcc, 0x1e, 0x19, 0x49, 0xe0, 0x5c, 0x23, 0xec, 0xa8, 0xb9, 0x8a, 0x9a, 0xc1, 0xf7, 0x83, 0xfe, 0x3b, 0x48, 0x44]
        try! computedBigInt.set("61344910120423901417682508861433655792482432536131290366293772313666283849796")
        var computedBytes = try! [UInt8](computedBigInt, count: 32)
        XCTAssertEqual(expectedBytes, computedBytes)
        // 95004871310069848391268557433239758444231662173989902038667203181907453754690 --> [0xd2, 0xa, 0xda, 0x2, 0x15, 0xf5, 0xb0, 0xc1, 0x19, 0x1b, 0xcd, 0x64, 0xd1, 0xb4, 0xdc, 0xd8, 0x32, 0x12, 0x97, 0xf2, 0xbf, 0x2, 0x3, 0xc9, 0x3c, 0x9d, 0x5b, 0x7d, 0x45, 0xdd, 0x3d, 0x42] (on 32 bytes)
        expectedBytes = [0xd2, 0xa, 0xda, 0x2, 0x15, 0xf5, 0xb0, 0xc1, 0x19, 0x1b, 0xcd, 0x64, 0xd1, 0xb4, 0xdc, 0xd8, 0x32, 0x12, 0x97, 0xf2, 0xbf, 0x2, 0x3, 0xc9, 0x3c, 0x9d, 0x5b, 0x7d, 0x45, 0xdd, 0x3d, 0x42]
        try! computedBigInt.set("95004871310069848391268557433239758444231662173989902038667203181907453754690")
        computedBytes = try! [UInt8](computedBigInt, count: 32)
        XCTAssertEqual(expectedBytes, computedBytes)
        // 95004871310069848391268557433239758444231662173989902038667203181907453754690 does not fit on 31 bytes
        do {
            _ = try [UInt8](computedBigInt, count: 31)
        } catch BigIntError.insufficientNumberOfBytes {
        } catch {
            XCTFail("Compute a BigInt into an array with as insufficient number of bytes should fail")
        }
        // 95004871310069848391268557433239758444231662173989902038667203181907453754690 --> [0x00, 0xd2, 0xa, 0xda, 0x2, 0x15, 0xf5, 0xb0, 0xc1, 0x19, 0x1b, 0xcd, 0x64, 0xd1, 0xb4, 0xdc, 0xd8, 0x32, 0x12, 0x97, 0xf2, 0xbf, 0x2, 0x3, 0xc9, 0x3c, 0x9d, 0x5b, 0x7d, 0x45, 0xdd, 0x3d, 0x42] (on 33 bytes)
        expectedBytes = [0x00, 0xd2, 0xa, 0xda, 0x2, 0x15, 0xf5, 0xb0, 0xc1, 0x19, 0x1b, 0xcd, 0x64, 0xd1, 0xb4, 0xdc, 0xd8, 0x32, 0x12, 0x97, 0xf2, 0xbf, 0x2, 0x3, 0xc9, 0x3c, 0x9d, 0x5b, 0x7d, 0x45, 0xdd, 0x3d, 0x42]
        try! computedBigInt.set("95004871310069848391268557433239758444231662173989902038667203181907453754690")
        computedBytes = try! [UInt8](computedBigInt, count: 33)
        XCTAssertEqual(expectedBytes, computedBytes)
        // Trying to get the bytes of a negative integer should fail
        computedBigInt.set(-1)
        do {
            _ = try [UInt8](computedBigInt, count: 1)
        } catch BigIntError.cannotEncodeNegativeBigInt {
        } catch {
            XCTFail("Encode a negative BigInt into an array should fail")
        }
    }

    func testSqrtMod() {
        let p = try! BigInt("1267650600228229401496703205653") /* p mod 4 != 3 */
        let x = try! BigInt("771599126271801172792053417683")
        let xSquare = BigInt()
        BigInt.powm(rop: xSquare, base: x, exp: 2, modulo: p)
        let y1 = BigInt()
        let y2 = BigInt()
        try! BigInt.sqrtm(rop1: y1, rop2: y2, op: xSquare, p: p)
        XCTAssertTrue(x == y1 || x == y2)

        try! p.set("1267650600228229401496703205707") /* p mod 4 == 3 */
        BigInt.powm(rop: xSquare, base: x, exp: 2, modulo: p)
        try! BigInt.sqrtm(rop1: y1, rop2: y2, op: xSquare, p: p)
        XCTAssertTrue(x == y1 || x == y2)

        try! p.set("1267650600228229401496703205953") /* p mod 4 != 3 and g = 3 */
        BigInt.powm(rop: xSquare, base: x, exp: 2, modulo: p)
        try! BigInt.sqrtm(rop1: y1, rop2: y2, op: xSquare, p: p)
        XCTAssertTrue(x == y1 || x == y2)

        try! p.set("1267650600228229401496703205953")
        try! xSquare.set("1101122138913917167757985481733") // Not a square
        var correctExceptionWasRaised = false
        do {
            try BigInt.sqrtm(rop1: y1, rop2: y2, op: xSquare, p: p)
        } catch BigIntError.noSquareRootExists {
            correctExceptionWasRaised = true
        } catch {}
        XCTAssertTrue(correctExceptionWasRaised)

    }

